// entity-rotator.js
const EntityRotator = pc.createScript('EntityRotator');
const _tempVec3 = new pc.Vec3();
const _tempQuat = new pc.Quat();

EntityRotator.attributes.add("useLocalRotation", {
    type: "boolean",
    default: false
});

EntityRotator.prototype.initialize = function() {
    const rotation = this.getRotation();
    this._rotationEuler = rotation.getEulerAngles();
};

EntityRotator.prototype.update = function(dt) {
    const rotationEuler = this._rotationEuler;
    _tempVec3.copy(this.degreesPerSecond);
    _tempVec3.mulScalar(dt);
    rotationEuler.add(_tempVec3);
    rotationEuler.x %= 360;
    rotationEuler.y %= 360;
    rotationEuler.z %= 360;

    _tempQuat.setFromEulerAngles(rotationEuler.x, rotationEuler.y, rotationEuler.z);

    if (this.useLocalRotation) {
        this.entity.setLocalRotation(_tempQuat);
    } else {
        this.entity.setRotation(_tempQuat);
    }
};

EntityRotator.prototype.getRotation = function() {
    return this.useLocalRotation ? this.entity.getLocalRotation() : this.entity.getRotation();
};

EntityRotator.prototype.setRotation = function(rotation) {
    if (this.useLocalRotation) {
        this.entity.setLocalRotation(rotation);
    } else {
        this.entity.setRotation(rotation);
    }
};

EntityRotator.attributes.add("degreesPerSecond", {
    type: "vec3"
});


