var RotateAndScale = pc.createScript('rotateAndScale');

// Attribute to link the target entity in the PlayCanvas editor
RotateAndScale.attributes.add('targetEntity', {
    type: 'entity'
});

// Rotation settings
RotateAndScale.attributes.add('minRotation', {
    type: 'number',
    default: 30
});
RotateAndScale.attributes.add('maxRotation', {
    type: 'number',
    default: 60
});
RotateAndScale.attributes.add('rotationSpeed', {
    type: 'number',
    default: 5
});

// Scale settings
RotateAndScale.attributes.add('minScale', {
    type: 'number',
    default: 0.8
});
RotateAndScale.attributes.add('maxScale', {
    type: 'number',
    default: 1.2
});
RotateAndScale.attributes.add('scaleSpeed', {
    type: 'number',
    default: 3
});

RotateAndScale.prototype.initialize = function() {
    this.currentRotation = 0;
    this.currentScale = 1;

    // Flags to track if we're rotating/scaling up or down
    this.rotatingUp = true;
    this.scalingUp = true;
};

RotateAndScale.prototype.update = function(dt) {
    if (this.targetEntity) {

        // Rotation
        if (this.rotatingUp) {
            this.currentRotation += this.rotationSpeed * dt;
            if (this.currentRotation >= this.maxRotation) {
                this.currentRotation = this.maxRotation;
                this.rotatingUp = false;
            }
        } else {
            this.currentRotation -= this.rotationSpeed * dt;
            if (this.currentRotation <= this.minRotation) {
                this.currentRotation = this.minRotation;
                this.rotatingUp = true;
            }
        }
        this.targetEntity.rotateLocal(0, this.currentRotation, 0);

        // Scale (no changes needed here, it was already local)
        if (this.scalingUp) {
            this.currentScale += this.scaleSpeed * dt;
            if (this.currentScale >= this.maxScale) {
                this.currentScale = this.maxScale;
                this.scalingUp = false;
            }
        } else {
            this.currentScale -= this.scaleSpeed * dt;
            if (this.currentScale <= this.minScale) {
                this.currentScale = this.minScale;
                this.scalingUp = true;
            }
        }
        this.targetEntity.setLocalScale(this.currentScale, this.currentScale, this.currentScale);
    }
};


