// BulletImpactEffect.js
var BulletImpactEffect = pc.createScript('bulletImpactEffect');

// Initialize attributes with default values
BulletImpactEffect.attributes.add('scaleUpSize', {
    type: 'number',
    default: 1.5
});
BulletImpactEffect.attributes.add('scaleDownSize', {
    type: 'number',
    default: 0
});
BulletImpactEffect.attributes.add('duration', {
    type: 'number',
    default: 0.5
});

BulletImpactEffect.prototype.initialize = function() {
    this.originalScale = this.entity.getLocalScale().clone(); // Store original scale
    this.timer = 0;
};

BulletImpactEffect.prototype.update = function(dt) {
    this.timer += dt;

    // Check if the effect has completed
    if (this.timer >= this.duration) {
        this.entity.setLocalScale(this.originalScale.x * this.scaleDownSize, this.originalScale.y * this.scaleDownSize, this.originalScale.z * this.scaleDownSize);
        this.entity.destroy(); // Destroy the entity at the end
        return;
    }

    let t = this.timer / this.duration;

    // Calculate the scale value based on time progression, considering easing
    let scale;
    if (t < 0.5) {
        // Scale up
        scale = pc.math.lerp(this.originalScale.x, this.originalScale.x * this.scaleUpSize, t * 2);
    } else {
        // Scale down
        scale = pc.math.lerp(this.originalScale.x * this.scaleUpSize, this.originalScale.x * this.scaleDownSize, (t - 0.5) * 2);
    }

    this.entity.setLocalScale(scale, scale, scale);
};


