var OpenPodDoor = pc.createScript('openPodDoor');

// Editor attributes to set start rotation, end rotation, and local/global rotation
OpenPodDoor.attributes.add('startRotation', {
    type: 'vec3',
    title: 'Start Rotation'
});

OpenPodDoor.attributes.add('endRotation', {
    type: 'vec3',
    title: 'End Rotation'
});

OpenPodDoor.attributes.add('useLocal', {
    type: 'boolean',
    default: true,
    title: 'Use Local Rotation'
});

// New attribute for particle effect
OpenPodDoor.attributes.add('particle', {
    type: 'entity',
    title: 'Particle Effect'
});

OpenPodDoor.prototype.initialize = function() {
    this.triggered = false;
    this.startQuat = new pc.Quat().setFromEulerAngles(this.startRotation.x, this.startRotation.y, this.startRotation.z);
    this.endQuat = new pc.Quat().setFromEulerAngles(this.endRotation.x, this.endRotation.y, this.endRotation.z);

    // Set the initial rotation
    if (this.useLocal) {
        this.entity.setLocalRotation(this.startQuat);
    } else {
        this.entity.setRotation(this.startQuat);
    }

    this.entity.collision.on('triggerenter', this.onTriggerEnter, this);

    // Deactivate the particle effect initially
    if (this.particle) {
        this.particle.enabled = false;
    }
};

OpenPodDoor.prototype.onTriggerEnter = function(otherEntity) {
    if (otherEntity.tags.has('Player') && !this.triggered) {
        this.triggered = true;
        this.slerpRotation();

        // Play sound effect
        if (this.entity.sound.slot('slot1')) {
            this.entity.sound.play('slot1');
        }

        // Activate particle effect
        if (this.particle) {
            this.particle.enabled = true;
        }
    }
};

OpenPodDoor.prototype.slerpRotation = function() {
    var time = 0;
    var duration = 2; // Adjust this for the duration of the slerp
    var startQuat = this.startQuat.clone();
    var endQuat = this.endQuat.clone();

    this.app.on('update', function(dt) {
        if (this.triggered && time < duration) {
            time += dt;
            var t = pc.math.clamp(time / duration, 0, 1);
            var currentQuat = new pc.Quat().slerp(startQuat, endQuat, t);

            if (this.useLocal) {
                this.entity.setLocalRotation(currentQuat);
            } else {
                this.entity.setRotation(currentQuat);
            }
        }
    }, this);
};


