// Define the script
var ScaleEntity = pc.createScript('scaleEntity');

// Script attributes for configuration in the editor
ScaleEntity.attributes.add('startScale', {
    type: 'number',
    default: 1,
    title: 'Start Scale'
});
ScaleEntity.attributes.add('endScale', {
    type: 'number',
    default: 2,
    title: 'End Scale'
});
ScaleEntity.attributes.add('scaleDuration', {
    type: 'number',
    default: 0.5,
    title: 'Scale Duration (seconds)'
});
ScaleEntity.attributes.add('waitDuration', {
    type: 'number',
    default: 2,
    title: 'Wait Duration (seconds)'
});

// Initialize the script
ScaleEntity.prototype.initialize = function() {
    this.timer = 0;
    this.scaling = false;
    this.scaleDirection = 1; // 1 for scaling up, -1 for scaling down
    this.entity.setLocalScale(this.startScale, this.startScale, this.startScale);
    this.currentScale = this.startScale;
};

// Update function called every frame
ScaleEntity.prototype.update = function(dt) {
    this.timer += dt;

    // Check if we are currently scaling
    if (this.scaling) {
        // Calculate the lerp factor
        var lerpFactor = this.timer / this.scaleDuration;

        // Perform lerp between start and end scale based on direction
        if (this.scaleDirection === 1) {
            this.currentScale = pc.math.lerp(this.startScale, this.endScale, lerpFactor);
        } else {
            this.currentScale = pc.math.lerp(this.endScale, this.startScale, lerpFactor);
        }

        // Apply the new scale to the entity
        this.entity.setLocalScale(this.currentScale, this.currentScale, this.currentScale);

        // Check if the scaling duration has been reached
        if (this.timer >= this.scaleDuration) {
            this.timer = 0;
            this.scaling = false;
        }
    } else {
        // Wait for the specified duration before starting the next scaling operation
        if (this.timer >= this.waitDuration) {
            this.timer = 0;
            this.scaling = true;
            this.scaleDirection *= -1; // Reverse the scaling direction
        }
    }
};


