// MoveAndDestroy.js
var MoveAndDestroy = pc.createScript('moveAndDestroy');

// Define the two entities, the duration, and the autoDestroy boolean
MoveAndDestroy.attributes.add('entityA', {
    type: 'entity',
    title: 'Entity A'
});
MoveAndDestroy.attributes.add('entityB', {
    type: 'entity',
    title: 'Entity B'
});
MoveAndDestroy.attributes.add('duration', {
    type: 'number',
    default: 1,
    title: 'Duration (Seconds)'
});
MoveAndDestroy.attributes.add('autoDestroy', {
    type: 'boolean',
    default: true,
    title: 'Auto Destroy Entity A'
});

const tempVec3s = [new pc.Vec3(), new pc.Vec3()];
const tempQuat = new pc.Quat();

// Initialize the script
MoveAndDestroy.prototype.initialize = function() {
    this.startTime = 0;
    this.elapsedTime = 0;
    this.moving = true;

    // Capture initial position, rotation, and scale of Entity A
    this.startPosition = this.entityA.getPosition().clone();
    this.startRotation = this.entityA.getRotation().clone();
    this.startScale = this.entityA.getLocalScale().clone();

    // Get target position, rotation, and scale of Entity B
    this.targetPosition = this.entityB.getPosition().clone();
    this.targetRotation = this.entityB.getRotation().clone();
    this.targetScale = this.entityB.getLocalScale().clone();
};

// Update the script every frame
MoveAndDestroy.prototype.update = function(dt) {
    if (!this.moving) {
        return;
    }

    const duration = this.duration;
    this.elapsedTime += dt;
    var t = duration > 0 ? this.elapsedTime / this.duration : 1;

    // Move Entity A towards Entity B
    if (t < 1) {
        // Interpolate position, rotation, and scale
        var newPosition = tempVec3s[0].lerp(this.startPosition, this.targetPosition, t);
        var newRotation = tempQuat.slerp(this.startRotation, this.targetRotation, t);
        var newScale = tempVec3s[1].lerp(this.startScale, this.targetScale, t);

        // Apply the interpolated values to Entity A
        this.entityA.setPosition(newPosition);
        this.entityA.setRotation(newRotation);
        this.entityA.setLocalScale(newScale);
    } else {
        // Snap to final position, rotation, and scale
        this.entityA.setPosition(this.targetPosition);
        this.entityA.setRotation(this.targetRotation);
        this.entityA.setLocalScale(this.targetScale);

        // Check if autoDestroy is true, then destroy Entity A
        if (this.autoDestroy) {
            this.entityA.destroy();
        }
        this.moving = false;
    }
};


